package com.blob.image.task;

import java.io.FileOutputStream;
import java.io.IOException;
import java.util.Base64;

public class SaveBase64ImageToLocal {
    public static void main(String[] args) {
        String base64Image = "";
        String outputImagePath = "C:\\Users\\NikhilDubey\\Downloads\\image.jpg"; // Specify the output image path

        try {
            // Decode the Base64 string to a byte array
            byte[] imageBytes = Base64.getDecoder().decode(base64Image);

            // Create a FileOutputStream to save the image
            FileOutputStream imageOutputStream = new FileOutputStream(outputImagePath);

            // Write the image data to the output file
            imageOutputStream.write(imageBytes);
            imageOutputStream.close();

            System.out.println("Image saved to " + outputImagePath);
        } catch (IOException e) {
            e.printStackTrace();
        }
    }
}
